import React, { Component } from 'react'
import Container from 'react-bootstrap/Container'

import {
    Switch,
    withRouter
  } from "react-router-dom"
import SummaryComponent from './SummaryComponent';
import UnitsComponent from './UnitsComponent';
import AuthenticatedRoute from './AuthenticatedRoute';
import Nav from 'react-bootstrap/Nav'

class ProjectDetailsComponent extends Component {

    constructor(props) {
        super(props)

        this.state = {
            key: "summary"
            // this.props.key
        }

        this.handleSelect = this.handleSelect.bind(this);
    }

    handleSelect(key) {
        console.log('selected' + key);
        this.setState({ key: key });
        alert('selected' + key)
    }

    render() {
        console.log(this.props.match)
        let url = this.props.match.url
        console.log(this.props.match.url)
        let path = this.props.match.path
        console.log(this.state.key);

        return (
            <Container className="mt-3">

                {/* Navigation tabs */}
                <Nav justify variant="tabs" activeKey={this.state.key} 
                // onSelect={(selectedKey) => alert(`selected ${selectedKey}`)}
                onSelect={this.handleSelect}> 
                <Nav.Item>
                    <Nav.Link eventKey="summary" href={url}>
                        Summary
                    </Nav.Link>
                </Nav.Item>
                <Nav.Item>
                <Nav.Item>
                    <Nav.Link eventKey="disabled" disabled>
                    Staff
                    </Nav.Link>
                </Nav.Item>
                </Nav.Item>
                <Nav.Item >
                    {/* <Nav.Link eventKey="units" href={`${url}/units`}>Units</Nav.Link> */}
                    <Nav.Link eventKey="units" to={{
                        pathname: `${url}/units`, 
                        state: { 
                            key: "units" 
                        }
                    }}>Units</Nav.Link>
                </Nav.Item>
                </Nav>

                <Switch>
                    <AuthenticatedRoute exact path={path} component={SummaryComponent}/>
                    {/* <h3>Please select a topic.</h3>
                    </Route> */}
                    {/* <AuthenticatedRoute path={`${path}/summary`}  /> */}
                    <AuthenticatedRoute exact path={`${path}/units`} component={UnitsComponent} />
                </Switch>


                {/* <Route path="/admin/groups" component={AdminGroups} /> */}

                {/* </Row> */}
            </Container>
        )
    }
}

export default withRouter(ProjectDetailsComponent)
